import React from 'react'

function Tracks({response}) {
    
    let topten = [];
    let showall;

    if(response !== null){
        for(let i=0 ; i<10 ; i++){
            topten.push(response.data.data[i]);
        }

        topten.forEach(function(item,index){
            console.log(item,index);
            let songname = item.title_short;
            console.log(songname);
        });

        showall = () =>{
            topten.map(item=>{
                return(<h1>item.title_short</h1>);
            })
        }

    }

    return (
        <div>
            {showall}
        </div>
    )
}

export default Tracks
